import React from 'react';
import Navbar from '../../components/Navbar/Navbar';
import { Apis } from '../../components/RequestApi';
import Banner from '../../components/Banner/Banner';

const Browse = ()=>{
	const  {
		trendDings,
		netflixOriginals,
		topRated,
		actionMovies,
		comedyMovies,
		horrorMovies,
		romanceMovies,
		documentaries,
	} = Apis();
	return <div className='app'>
		<Navbar/>
		<Banner/>
	</div>
}

export default Browse;
